import React from 'react';
import ReactDOM from 'react-dom';
import {Provider} from 'react-redux'

import TodoList from './todoList'
import store from './store/index'

ReactDOM.render(
  (
    <Provider store={store}>
      <TodoList />
    </Provider>
  ),
  document.getElementById('root')
);
